import React from 'react';

const ArticlePage = ({ match }) => {

    return 
    (<React.Fragment>
    <h1>React.js: the wonder</h1>
    <p>This is the article about React.js</p>
    <p>I love React.js! It is amazing!</p>
    </React.Fragment>);
}

export default ArticlePage;
